import React from "react";
import ReactDOM from "react-dom";
import {BrowserRouter as Router,Routes ,Route} from "react-router-dom";
import Navbar from './components/Navbar'

import './App.css';

function App() {
  return (
    <>
      <Router>
        <Navbar />
        <Routes>
          <Route path='/'  exact />
        </Routes>
      </Router>
    </>
  );
}

export default App;
